import React from 'react';

const Search = (props) => {
      return(
        <form className='searchWrapper'>
          <i class="fa-brands fa-youtube"></i>
          <div className="youtubeText">Youtube</div>
          <input type="text" />
          <button><i className="fa-solid fa-magnifying-glass"></i></button>
        </form>
      );
  };

export default Search;
